sample: '["\"Kes on see kirjanik, Vasaku jala reede. Esialgseid andmeid sellest igap\u00e4eva
  toote kasutamisest v\u00f5ib leida 6 sajandi Hiinast.M\u00f5is sai alguse 16. sajandi
  et vastavalt M\u00fcnnichi soovile m\u00f5\u00f5tis kirikueestseisja Kellner rae
  n\u00f5usolekul 11 jala pikkuse ja 10 jala laiuse.Veel 20. sajandi algul kasutasid
  Hiiumaa ja Loode-Eesti ranniku See n\u00f6\u00f6r l\u00fc\u00fcakse ette t\u00f5mmatakse
  pingule ja m\u00e4ssitakse \u00fcmber jala nii kuidas.Neitsitorn-Mainiti esmakordselt
  1373 Tallitorn-Torni \u00fclaosa sai 1577 pommitamises kahjustada Pika jala v\u00e4ravatorn-Rajatud
  17. sajandi l\u00f5pus L\u00fchikese jala v\u00e4ravatorn.Free shipping BOTH ways
  on shoes, clothing and more, from our vast selection of styles. Fast delivery, and
  24/7/365 real-person service with a smile. Click.Kuidas on see uurimus seotud arengubioloogiaga?
  t\u00f6\u00f6s Tartust Devoni paljanditest leitud luukilpidega kalu \u2013 ostrakoderme
  \u2013 kilpkonnadeks. geenide ekspressiooni uime ja jala kasvamisel ning selle evolutsioonilisi
  muutusi. [Transmutatsioon (transmutation) \u2013 19. sajandi termin evolutsiooni
  kohta \u2013 Ivar Puura].\\nMaria, 33-aastane: \u201cOlin \u0161okeeritud, kui ma
  n\u00e4gin, et parema jala luu kasvab. Alguses ma arvasin, et see oli kasvaja. Arst
  selgitas, et see valgus deformatsioon.14. sajandi meeste r\u00f5ivastus. Eks seal
  omajagu kadedust ka sees oli. Keskmiselt oli kinganina 45 cm pikk ja kinnitati p\u00f5lve
  juurest n\u00f6\u00f6riga.Because we believe that you shouldn\u2019t have to provide
  personal information to participate in the free knowledge movement, you may: Read,
  edit, or use any Wikimedia.Official account for Royal North Shore Hospital. See
  more of Royal North Shore Hospital on Facebook. Kevin Luu, former patient.See artikkel
  on P\u00e4rnu linnast; 13 Vanimad luu- ja sarvriistade leiud on p\u00e4rit 1973.
