  600 linnas \u00fcle maailma sh Tallinnas.\"", "\"BC Kalev/Cramo on sel hooajal katsetanud
  koosseisus erinevaid mehi ja tundub, et ehituskivid hakkavad paika loksuma. \u00dcks
  palluritest, kes j\u00e4rjest paremini sisse elab on ameeriklane Michael Finke.
