  Eesti-L\u00e4ti liigas asub Kalev/Cramo kindlalt kolmandal kohal ja VTB liigas hoitakse
  kuue v\u00f5idu ning kaheksa kaotusega kuuendat positsiooni.\\nKorvpall24.ee k\u00e4is
  koos NBA agentidega Kalevi Spordihallis vaatamas Kalev/Cramo ja Saraatovi Avtodori
