  r\u00e4\u00e4kisime Michael Finkega, et aru saada mis mehega t\u00e4pselt tegu on.\\nEsmalt
  vestlesime m\u00e4ngust Avtodoriga, mille kohta pallur r\u00e4\u00e4kis kiitvalt:
  \u201cViisime oma m\u00e4nguplaani h\u00e4sti ellu. Olime selleks kohtumiseks k\u00f5vasti
