  \u201cMeil on kaitserotatsioon ka selline, et vahetame v\u00e4ga palju ja abistame
  seda, kes on oma mehega h\u00e4tta j\u00e4\u00e4nud. Nii oli ka Avtodori m\u00e4ngus.
