  suure publiku, skautide ja teleekraanide ees m\u00e4nginud. Meie \u00fclikool kuulus
  USA 10 parema sekka. Olen noorest saadik pinge all pallinud.\u201d Kas keegi Kalev/Cramost
  v\u00f5is agentidele silma j\u00e4\u00e4da, ei osanud Finke v\u00e4lja tuua: \u201cMeil
  on palju talendikaid pallureid. Hetkel keegi ei m\u00f5tle NBA-le, sest meil on
