  k\u00f5ik visked ise tahaks peale v\u00f5tta. Pean veel f\u00fc\u00fcsilise poole
  ja kiire tempoga \u00e4ra harjuma. Tunnen, et ka rahvas on mu h\u00e4sti vastu v\u00f5tnud
  ja peagi saabub mu kihlatu siia. K\u00f5ik on seega h\u00e4sti.\u201d\\nEelistustest
  ja lemmikutest j\u00f5udsime ka r\u00e4\u00e4kida. Parim keskm\u00e4ngija on Finke
  meelest Shaquille O\u2019Neal: \u201cTa oli lihtsalt t\u00e4ielik koll korvi all.
  Shaq v\u00f5is \u00fcle \u00fcksk\u00f5ik kelle pealt panna ja liikus oma suuruse
