  m\u00e4ngides.\u201d H\u00e4sti viskavatest suurtest \u00e4\u00e4rtest eelistaks
  Kevin Garnetti Dirk Nowitzkile: \u201cMulle lihtsalt tema m\u00e4ngustiil meeldis.
