  domineerimisest korvile l\u00e4hemal.\u201d\\nFinke eelistaks LeBron Jamesi James
  Hardenile, sest ta suudab oma meeskonda palju paremaks muuta: \u201cLeBron v\u00f5ib
  visata ise 30 silma, aga sinna juurde annab lisaks 15 korvis\u00f6\u00f6tu. Paljudele
  on temaga koos m\u00e4ngida meeldinud ja \u00fchtlasi on teda l\u00f5bus m\u00e4ngimas
  n\u00e4ha. Kui nende meeste juurde veel Sander Raieste lisada, siis on juba v\u00e4ga
  hea meeskond (muheleb \u2013 toim.). Raieste on noor, andekas ja suure potentsiaaliga
  m\u00e4ngumees.\u201d\"", "\"Eesti ootab eurorahade rakenduskavale Euroopa Komisjoni
