  \u2013 kerkinud energiahindade ja suurenenud t\u00f6\u00f6j\u00f5ukulude...\\nPakend
  ja toit selle sees on \u00fcks tervik \u2013 see on komplekt emotsioonist ja innovatsioonist,
  toiduohutusest ja kestlikust eluviisist, taimekasvatusest...\"", "\"Elu ja hetki
  \u00f5petavad hindama tihti keerulised elusituatsioonid, rasked kriisid v\u00f5i
  t\u00f5elised hingeraputused. Aga mis oleks, kui peatuks hetkeks, hingaks s\u00fcgavalt
  sisse ja v\u00e4lja, sulgeks silmad ja \u00fctleks elule lihtsalt: \u00abMa t\u00e4nan!
  T\u00e4nan, et elan!\u00bb Vahel pole elu ilu tundmiseks rohkem vajagi, kui peatuda
  ja tunda t\u00e4nulikkust, et \u00fcldse elame, hingame, armastame ja saame lihtsalt
  luua paremat maailma, sammhaaval. Elu ilu ongi ju peidus elus!\\nKolm Monique\u2019i
  luuletust elamise ilu teemal: ilus on olla elus\\nElu m\u00f5te\\nKui elu m\u00f5te
  on olla parem\\nalusta teistest palju varem\\ntee k\u00f5ik, mis tegema pead\\nja
  paranda tehtud vead\\nKui elu m\u00f5te on luua head\\nsiis heast m\u00f5tlema pead\\nkurjusel
  elus ei tohiks teha ruumi\\nelu heaks sa ise vaid tuunid\\nKui elu m\u00f5te on
  koguda hetki\\nreisi ees \u00e4ra l\u00f6\u00f6 ette risti\\ntee k\u00f5ike, mis
  p\u00e4he tuleb\\nmine sinna, kus s\u00fcda l\u00e4heb\\nKui elu m\u00f5te on elu
  ise\\npuudub keegi, kes poob ja k\u00e4seb\\nlase hingel lennelda vabalt\\nnii elu
  m\u00f5tte sa tabad\\nEi muutu miski enne sinu elus\\nKui istud kastis kinni sa\\nja
  vaatad taevast alla maad\\nk\u00f5ik maal nii v\u00e4ike tundub sul\\nka kardinate
  taga ainult muld\\nei n\u00e4e sa pilvepiiri taga inglit\\nkes sala sosistab sul
  kauneid s\u00f5nu\\nei taju p\u00e4ikest s\u00f5bra s\u00fcdames\\nkes vaikides
  teeb lauluviisi m\u00f5rust\\nei tunne armastust, kui s\u00f5nu pole\\nveel oma
  teatrit\u00fckki vead\\nei usu igatsust, kui teda pole\\nkuid omandiks sa k\u00f5iki
  pead\\nkui relvaks vihkamine, vaen ja valu\\nka teiste vikerkaart ei talu\\nei muutu
  enne miskit sinu elus\\nkui armastuse teed sa valust\\nIlus on olla\\nIlus on olla,
  kui armastus hinges\\nIlus on olla, kui ema on armas\\nIlus on olla, kui isa on
  hea\\nIlus on olla, kui siiras on s\u00f5ber\\nIlus on olla, kui teekond on p\u00f5nev\\nIlus
  on olla, kui lugu on kirev\\nIlus on olla, kui meeled on valla\\nIlus on olla, kui
  hinges on s\u00e4ra\\nIlus on olla, kui s\u00fcda on puhas\\nIlus on olla, kui elus
  end tunned\\nIlus on olla, kui elu on ilus\\nIlus on olla elus\"", "\"Hoiused\\nT\u00e4htajalisele
  hoiusele saab paigutada kindla summa kindlaks ajaperioodiks. Reeglina on t\u00e4htajaline
  hoius k\u00f5ige k\u00f5rgema intressiga.\\nLoe edasi T\u00e4htajalisest hoiusest\\nReservhoius
  on k\u00f5ige paindlikum hoius. Hoiusele saate raha alati juurde panna, vajadusel
  v\u00e4lja v\u00f5tta. Ja hoiuseintress muutub automaatselt koos turuintressiga.\\nLoe
  edasi Reservhoiusest\\nKui Teil j\u00e4\u00e4b tihti raha kogumiseks j\u00e4rjekindlusest
  puudu, siis on Teile m\u00f5eldud Kogumishoius. S\u00f5lmige leping ja iga kuu kantakse
  Teie arvelduskontolt kindel summa Kogumishoiusele.\\nLoe edasi Kogumishoiusest\\nKinkige
  oma lapsele lisaks m\u00e4nguasjadele stardikapital isesesiva elu alustamiseks,
  avage talle Lastehoius.\\nLoe edasi Lastehoiuset\"", "\"Juba valmistutakse \u00f5hinas
  kooseluseaduse vastaseks meeleavalduseks, internetifoorumid on t\u00e4is agressiivseid
  r\u00fcnnakuid teisitim\u00f5tlejate suunal ja inimeste postkastidesse tilguvad
  protestikirjad. Kaaskodanikud, mis teil viga on?\\nEuroopa tasandil noortevaldkonnas
  juba mitu aastat aktiivselt kaasa l\u00fc\u00fces olen ma harjunud sellega, et \u00fcks
  peamisi v\u00e4\u00e4rtusi noorteorganisatsioonides on sallivus sind \u00fcmbritsevate
  inimeste suhtes. Ole salliv, ole vastuv\u00f5tlik, ole s\u00f5bralik - seda s\u00f5ltumata
  inimese rassist, rahvusest, puudest, seksuaalselt orientatsioonist, usulistest eelistustest.
  Noored tunnevad ennast turvaliselt ja kaasatuna, seega on seltskond v\u00e4ga kirju
  ning iga\u00fchel on v\u00f5rdse kaaluga h\u00e4\u00e4l. Inimene on inimene ja muu
  ei loe.\\nKuigi Euroopa on oma suhtumises Eestist t\u00fckkmaad liberaalsem ei ole
  ka seal veel k\u00f5ik v\u00e4hemused alati kaitstud. Kinnistamaks sallivust ja
  kaitsmaks inimeste \u00f5igusi alustas 2012. aastal Euroopa N\u00f5ukogu noorte
  kampaaniaga \u00abno hate speech\u00bb (\u00abei vihak\u00f5nele\u00bb). Kampaania
  on suunatud interneti avarustes leviva vihak\u00f5ne ja diskrimineerimise vastu.
  Selle raames t\u00f5stetakse \u00fchiskonna teadlikkust vihak\u00f5ne olemasolust,
  kaardistatakse probleemid, kasvatatakse solidaarsust ja \u00fchtlasi ka t\u00e4isv\u00e4\u00e4rtuslikke
  ja sallivaid maailmakodanikke.\\nEesti juhtumit vaadates on mul selline tunne, et
  meil oleks vaja lausa oma \u00abno hate speech\u00bb arengukava. Ja seda mitte ainult
  noorte kontekstis, vaid k\u00f5igi meie \u00fchiskonna kihtide l\u00f5ikes. Ja mitte
  ainult interneti dimensioonis, vaid lausa regionaalsel tasandil. J\u00e4ttes unarusse
  sellised m\u00e4rks\u00f5nad nagu \u00abv\u00f5rdne kohtlemine\u00bb, \u00abv\u00e4\u00e4rikus\u00bb,
  \u00abinim\u00f5igused\u00bb ja \u00abmitmekesisus\u00bb j\u00f5uame me vaid selleni,
  et Eesti riigi elanikel ei ole turvatunnet ning siis nad lahkuvadki. Kes siis meie
  traditsioone edasi viib?\\nEesti vabariigi p\u00f5hiseaduses seisab: K\u00f5ik on
  seaduse ees v\u00f5rdsed. Kedagi ei tohi diskrimineerida rahvuse, rassi, nahav\u00e4rvuse,
  soo, keele, p\u00e4ritolu, usutunnistuse, poliitiliste v\u00f5i muude veendumuste,
  samuti varalise ja sotsiaalse seisundi v\u00f5i muude asjaolude t\u00f5ttu. Rahvusliku,
  rassilise, usulise v\u00f5i poliitilise vihkamise, v\u00e4givalla ja diskrimineerimise
  \u00f5hutamine on seadusega keelatud ja karistatav. Samuti on seadusega keelatud
  ja karistatav \u00f5hutada vihkamist, v\u00e4givalda ja diskrimineerimist \u00fchiskonnakihtide
  vahel.\\nK\u00f5igile meile meeldetuletuseks. T\u00e4nuv\u00e4\u00e4rt t\u00f6\u00f6d
  teevad meie v\u00f5imuesindajad, kes t\u00f6\u00f6tavad kooseluseadusega edasi ning
  \u00fcritavad kaitsta nii paljude Eesti elanike \u00f5igusi kui v\u00f5imalik.\"",
